import { useNavigate } from "react-router-dom";

import "../Home.css";
import "../fonts/fonts.css";

function Home() {
  const navigate = useNavigate();

  return (
    <div className="Home">
      <div className="title">
        <h1>
          -------------------
          <br />
          {/* 사용자 취향 기반
        <br />
        여행 경로 추천 서비스 */}
          Trip to Jeju
          <br />
          ---------------------
        </h1>
      </div>
      <br />
      <div id="how">
        <text>
          예정된 여행에 대한 간단한 정보를 선택해주시면
          <br />
          그에 맞는 <b id="emp">3가지 여행 경로</b>를 추천해드릴게요!
          <br />
        </text>
      </div>
      <button
        id="start"
        onClick={() => {
          navigate("/checkinfo");
        }}
      >
        정보 선택{"\u2192"}
      </button>
    </div>
  );
}

export default Home;
